def download_image(base64img):
    procc = base64.b64decode(base64img)
    image = Image.open(BytesIO(procc))
    iconPathExist = os.path.exists(iconPath)
    if not iconPathExist:
        image.save(iconPath)
        return iconPath
    else:
        return iconPath
